import { Search } from '@mui/icons-material';
import { AppBar, Button, ListItemButton, Stack, Tab, Tabs } from '@mui/material'
import React, { useState } from 'react'



const Tabswitch = () => {
    const[value,setValue]= useState();
  return (
    <div ><toolbar>
     <Tabs textColor="inherit"indicatorColor="secondary" value={value} onChange={(e,value)=>setValue(value)} sx={{ padding:'20px'}}>
                <Tab label="Source1" />
                <Tab label="Source2"/>
                <Tab label="Source3"/>
            </Tabs>
     <Button sx={{marginRight:'auto'}}>
    <Search/>
     </Button>
     </toolbar>
    </div>
  )
}

export default Tabswitch
